	var _udBtneffect = function (obj, e) {
		try {

			$(".ud-ripple").remove();
			var posX = $(obj).offset().left,
				posY = $(obj).offset().top,
				buttonWidth = $(obj).width(),
				buttonHeight = $(obj).height();

			$(obj).prepend("<span class='ud-ripple'></span>");

			// Make it round!
			if (buttonWidth >= buttonHeight) {
				buttonHeight = buttonWidth;
			} else {
				buttonWidth = buttonHeight;
			}

			// Get the center of the element
			var x = e.pageX - posX - buttonWidth / 2;
			var y = e.pageY - posY - buttonHeight / 2;


			// Add the ripples CSS and start the animation
			$(".ud-ripple").css({
				width: buttonWidth,
				height: buttonHeight,
				top: y + 'px',
				left: x + 'px'
			}).addClass("ud-rippleEffect");
		}
		catch (err) {
			console.log(err.message);
		}
	}

	/*
	 * TweenLite animation
	 * @param string element
	 * @param int duration
	 * @param int opacity
	 * @param int x, int y, rotation
	 * */
	var tweenAnimation = function (element, duration, opacity, x, y, rotation) {
		TweenLite.to(element, duration, {
			ease:
			Circ.easeOut,
			opacity: opacity,
			x: x,
			y: y,
			rotation: rotation
		});
	};
	/*
	 * FadeIn and fadeOut text
	 * @param string element
	 * @param int duration
	 * @param int opacity
	 * @param int delay
	 * @return void
	 *
	 * */
	var fadeAnimation = function (element, duration, opacity, delay, marginRight) {
		TweenLite.to(element, duration, {
			opacity: opacity,
			delay: delay,
			marginRight: marginRight
		});
	}

